import React, { useState, useEffect } from 'react';
import { Card, CardBody, Button, Chip, Divider } from '@heroui/react';
import { 
  Users, 
  Package, 
  Key, 
  Settings,
  TrendingUp,
  RefreshCw,
  Eye,
  Calendar
} from 'lucide-react';
import { motion } from 'framer-motion';

interface DashboardStats {
  totalUsers: number;
  totalPackages: number;
  totalCDK: number;
  activeUsers: number;
  todayRevenue: number;
  monthlyRevenue: number;
}

const AdminDashboard: React.FC = () => {
  const [stats, setStats] = useState<DashboardStats>({
    totalUsers: 0,
    totalPackages: 0,
    totalCDK: 0,
    activeUsers: 0,
    todayRevenue: 0,
    monthlyRevenue: 0,
  });
  const [loading, setLoading] = useState(true);

  // 模拟数据加载
  useEffect(() => {
    const loadDashboardData = async () => {
      setLoading(true);
      // 模拟API调用延迟
      await new Promise(resolve => setTimeout(resolve, 1000));

      // 模拟数据
      setStats({
        totalUsers: 1248,
        totalPackages: 12,
        totalCDK: 350,
        activeUsers: 89,
        todayRevenue: 2580,
        monthlyRevenue: 45600,
      });

      setLoading(false);
    };

    loadDashboardData();
  }, []);

  const handleRefresh = () => {
    setLoading(true);
    setTimeout(() => setLoading(false), 1000);
  };

  const cardVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { 
      opacity: 1, 
      y: 0,
      transition: { duration: 0.3 }
    }
  };

  const statsCards = [
    {
      title: '总用户数',
      value: stats.totalUsers,
      icon: <Users size={24} />,
      color: '#3b82f6',
      bgColor: '#eff6ff',
      borderColor: '#3b82f6',
    },
    {
      title: '套餐总数',
      value: stats.totalPackages,
      icon: <Package size={24} />,
      color: '#10b981',
      bgColor: '#ecfdf5',
      borderColor: '#10b981',
    },
    {
      title: 'CDK总数',
      value: stats.totalCDK,
      icon: <Key size={24} />,
      color: '#f59e0b',
      bgColor: '#fffbeb',
      borderColor: '#f59e0b',
    },
    {
      title: '活跃用户',
      value: stats.activeUsers,
      icon: <TrendingUp size={24} />,
      color: '#ec4899',
      bgColor: '#fdf2f8',
      borderColor: '#ec4899',
    },
  ];

  const revenueCards = [
    {
      title: '今日收入',
      value: stats.todayRevenue,
      prefix: '¥',
      precision: 2,
      color: '#3b82f6',
    },
    {
      title: '月度收入',
      value: stats.monthlyRevenue,
      prefix: '¥',
      precision: 2,
      color: '#10b981',
    },
  ];

  return (
    <div className="space-y-6">
      {/* 页面标题 */}
      <div className="flex items-center justify-between">
        <div>
          <h2 className="text-2xl font-bold text-gray-800 mb-1">
            仪表盘
          </h2>
          <p className="text-sm text-gray-600">
            欢迎回来，管理员！这里是您的管理概览。
          </p>
        </div>
        <Button
          color="primary"
          startContent={<RefreshCw size={16} />}
          onClick={handleRefresh}
          isLoading={loading}
        >
          刷新数据
        </Button>
      </div>

      {/* 统计卡片 */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
        {statsCards.map((card, index) => (
          <motion.div
            key={index}
            variants={cardVariants}
            initial="hidden"
            animate="visible"
            transition={{ delay: index * 0.1 }}
          >
            <Card 
              className="border-l-4" 
              style={{
                backgroundColor: card.bgColor,
                borderLeftColor: card.borderColor,
              }}
            >
              <CardBody className="p-6">
                <div className="flex items-center justify-between">
                  <div>
                    <div className="text-sm text-gray-600 mb-1">
                      {card.title}
                    </div>
                    <div className="text-2xl font-bold text-gray-800">
                      {loading ? '加载中...' : card.value.toLocaleString()}
                    </div>
                  </div>
                  <div className="opacity-60" style={{ color: card.color }}>
                    {card.icon}
                  </div>
                </div>
              </CardBody>
            </Card>
          </motion.div>
        ))}
      </div>

      {/* 收入统计 */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        {revenueCards.map((card, index) => (
          <motion.div
            key={index}
            variants={cardVariants}
            initial="hidden"
            animate="visible"
            transition={{ delay: 0.4 + index * 0.1 }}
          >
            <Card>
              <CardBody className="p-6 text-center">
                <div className="text-base text-gray-600 mb-2">
                  {card.title}
                </div>
                <div 
                  className="text-3xl font-bold"
                  style={{ color: card.color }}
                >
                  {loading ? '加载中...' : `${card.prefix}${card.value.toFixed(card.precision)}`}
                </div>
              </CardBody>
            </Card>
          </motion.div>
        ))}
      </div>

      {/* 快速操作 */}
      <motion.div
        variants={cardVariants}
        initial="hidden"
        animate="visible"
        transition={{ delay: 0.6 }}
      >
        <Card>
          <CardBody className="p-6">
            <div className="flex items-center gap-2 mb-5">
              <Settings size={18} />
              <span className="text-base font-medium">快速操作</span>
            </div>

            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4">
              <Button
                color="primary"
                size="lg"
                fullWidth
                startContent={<Users size={18} />}
                as="a"
                href="/admin/users"
              >
                用户管理
              </Button>
              <Button
                color="primary"
                size="lg"
                fullWidth
                startContent={<Package size={18} />}
                as="a"
                href="/admin/packages"
              >
                套餐管理
              </Button>
              <Button
                color="primary"
                size="lg"
                fullWidth
                startContent={<Key size={18} />}
                as="a"
                href="/admin/cdk"
              >
                CDK管理
              </Button>
              <Button
                color="primary"
                size="lg"
                fullWidth
                startContent={<Settings size={18} />}
                as="a"
                href="/admin/config"
              >
                系统配置
              </Button>
            </div>
          </CardBody>
        </Card>
      </motion.div>

      {/* 系统状态 */}
      <motion.div
        variants={cardVariants}
        initial="hidden"
        animate="visible"
        transition={{ delay: 0.8 }}
      >
        <Card>
          <CardBody className="p-6">
            <div className="flex items-center gap-2 mb-5">
              <Eye size={18} />
              <span className="text-base font-medium">系统状态</span>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-5">
              <div className="flex items-center justify-center gap-2">
                <Chip color="success" size="sm" variant="flat">●</Chip>
                <span className="text-sm">API服务正常</span>
              </div>
              <div className="flex items-center justify-center gap-2">
                <Chip color="success" size="sm" variant="flat">●</Chip>
                <span className="text-sm">数据库连接正常</span>
              </div>
              <div className="flex items-center justify-center gap-2">
                <Chip color="success" size="sm" variant="flat">●</Chip>
                <span className="text-sm">支付系统正常</span>
              </div>
            </div>

            <Divider />

            <div className="flex items-center justify-center gap-2 mt-4 text-gray-600">
              <Calendar size={16} />
              <span className="text-sm">最后更新: {new Date().toLocaleString()}</span>
            </div>
          </CardBody>
        </Card>
      </motion.div>
    </div>
  );
};

export default AdminDashboard;
